import { styled } from 'styled-components';

const Container = styled.div`
  border: 1px solid #000;
  height: 500px;
  width: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Content = styled.div`
  width: 80%;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Information = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
  flex: 4;
  img {
    margin-bottom: 30px;
  }
  .info_title {
    font-weight: bold;
    font-size: 14px;
  }
  span {
    margin-bottom: 5px;
    font-size: 12px;
    line-height: 20px;
  }
`;

const Help = styled.div`
  border-right: 1px solid #000;
  border-left: 1px solid #000;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  flex: 1;
  padding-left: 50px;
  .title {
    margin-bottom: 20px;
    font-weight: bold;
  }
`;

const HelpText = styled.div`
  display: flex;
  flex-direction: column;
  margin-bottom: 20px;
  span {
    margin-bottom: 10px;
    font-size: 12px;
  }
`;

const Images = styled.div`
  padding-bottom: 20px;
  img {
    width: 40px;
    margin-right: 20px;
  }
`;


const Company = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  flex: 1;
  padding-left: 50px;
  .title {
    margin-bottom: 20px;
    font-weight: bold;
  }
`;

const CompanyText = styled.div`
  display: flex;
  flex-direction: column;
  margin-bottom: 80px;
  span {
    margin-bottom: 10px;
    font-size: 12px;
  }
`;

const Footer = () => {
  return(
    <Container>
      <Content>
        <Information>
          <img src='https://wiisnt.co.kr/images/cm_logo_1_4.png'/>
          <span className='info_title'>The purpose and intention of this site is to promote the CD album (What it isNt)</span>
          <span>(주)비케이브 서울 마포구 잔다리로 24, 5층(서교동, 서영빌딩)</span>
          <span>[24, Jandari-ro, Mapo-gu, Seoul, Republic of Korea] 대표. 윤형석 [Yun, Hyungseok]<br/>
            대표 전화번호. 02-338-3316 사업자 등록번호. 261-81-17293<br/>
            통신판매업 신고 2020-서울마포-4143
          </span>
        </Information>
        <Help>
          <span className='title'>HELP</span>
          <HelpText>
            <span>GUIDE</span>
            <span>TERMS & CONDITIONS</span>
            <span>PRIVACY POLICY</span>
          </HelpText>
          <Images>
            <img src='https://wiisnt.co.kr/images/facebook_icon.ico'/>
            <img src='https://wiisnt.co.kr/images/Instagram_icon.ico'/>
            <img src='https://wiisnt.co.kr/images/kakao_icon.ico'/>
            <img src='https://wiisnt.co.kr/images/youtube_icon.ico'/>
            <img src='https://wiisnt.co.kr/images/twitter_icon.ico'/>
          </Images>
        </Help>
        <Company>
          <span className='title'>COMPANY</span>
          <CompanyText>
            <span>ABOUT</span>
            <span>STOCKIST</span>
            <span>CONTACT</span>
          </CompanyText>
        </Company>
      </Content>
    </Container>
  )
}

export default Footer;
